import usericon from 'src\img\nav-usericon.png';


class Navbar extends Component {

    state = { 
        logo : usericon,
        usericon :"",
        username : "",
        mail : ""
    }

    render() { 
        return (
            <div className="nav">
                <div className="logo">
                    Hello World
                </div>
                <div className="user-details">

                </div>
            </div>
        );
    }

}

export default Navbar;
